const app = express()
app.use((req, res, next) => {


    express.json()(req, res, next);  // ONLY do express.json() if the received request is NOT a WebHook from Stripe.

})
app.use(express.urlencoded({
  extended: false
}))
app.use(cors())
app.use(fileupload())
app.use('/', express.static(path.join(__dirname, 'public'), {
