  WalletAddress: WalletAddress,
  WalletType: WalletType,
};

        const findcustom = { DisplayName : DisplayName}
        const FinData = { WalletAddress: WalletAddress };

        const select = { DisplayName : 1 , CustomUrl: 1, EmailId: 1 }
