   },

   value : {
    type: Array,
    default : []
   } ,
//    [ { index : {
//     type : Number } , value : { type : String} } ], 

    isActive : {
        type: Boolean,
        default : true
    },


})


const SubCategory = mongoose.model("SubCategory", SubCategorySchema, "SubCategory");
export default SubCategory;

